import React, { useState } from 'react'
import "./homenav.css"
function Homenav() {
    const [blackshow,setshow]=useState(false);
    if(window.scrollY > 100)
    {
        setshow(true);
    }
    else{
        setshow(false);
    }
    return (
        <>
        <div className={`lognav ${blackshow && "lognav-black"}`}>

            <img src="https://download.logo.wine/logo/Netflix/Netflix-Logo.wine.png" alt="" id="netflixlogo"></img>
            <ul>
                <li>Home</li>
                <li>Trending</li>
                <li>Movies</li>
                <li>Top Rated</li>
            </ul>
            <img src="https://d1ielco78gv5pf.cloudfront.net/assets/clear-495a83e08fc8e5d7569efe6339a1228ee08292fa1f2bee8e0be6532990cb3852.gif" alt="" id="img"></img>
        </div></>
    )
}

export default Homenav;
